iere un usuario válido.','Jetpack is already connected.'=>'Jetpack ya está conectado.','Blog is already registered'=>'El blog ya está registrado','There was an unspecified error registering the site'=>'Ha habido un error inesperado registrando el sitio','There was an issue validating this request.'=>'Ocurrió un error validando esta solicitud.','The required "nonce" parameter is missing.'=>'Falta el parámetro necesario «nonce».','Valid user is required'=>'Se requiere un usuario válido.','User not found.'=>'Usuario no encontrado.','Invalid user identifier.'=>'Identificador de usuario no válido.','Unable to load class %1$s. Please add the package that contains it using composer and make sure you are requiring the Jetpack autoloader'=>'No se puede cargar la clase %1$s. Utiliza el compositor para añadir el paquete que lo contiene y comprueba si necesitas utilizar el cargador automático de Jetpack','Textdomain aliases should be registered before the %1$s hook. This notice was triggered by the %2$s domain.'=>'Los alias de los dominios de texto deben registrarse antes del action hook de %1$s. Este aviso ha sido activado por el dominio %2$s.','Script "%s" depends on wp-i18n but does not specify "textdomain"'=>'El script «%s» depende de wp-i18n, pero no especifica «textdomain»','Boost is disconnected from WP.com'=>'Boost está desconectado de WP.com','Boost could not be connected to WP.com'=>'Boost no se pudo conectar a WP.com','Boost is connected to WP.com'=>'Boost está conectado a WP.com','Please specify a valid module. It should be one of %s'=>'Por favor, especifica un módulo válido. Debería ser uno de %s','Jetpack Boost is currently generating critical css for this page'=>'Jetpack Boost está actualmente generando el css crítico de esta página','\'%1$s\' has been %2$s.'=>'\'%1$s\' ha sido %2$s.','deactivated'=>'desactivado','activated'=>'activado','The \'%s\' module slug is invalid'=>'El slug del módulo \'%s\' no es válido','Your installation of Jetpack Boost is incomplete.